function chooseTemplate() {
  chooseData.map((val) => {
    dataHolder += `
             <div class="why_choose_boxes">
            <div class="why_choose_img">
                <img src="${val.img}" alt="">
            </div>
            <div class="why_choose_text">
                <p>${val.name}</p>
            </div>
        </div>
        `;
  });
  document.getElementById("WhyChooseSec").innerHTML = dataHolder;
}

